#include <iostream>
#include <vector>
#include <unordered_set>
#include <deque>
using namespace std;

class Solution {
public:
    void solve(vector<vector<char>>& board) {
        if (board.empty() || board.front().empty())
            return;
        int row = (int)board.size(), col = (int)board.front().size();
        deque<pair<int,int>> q;
        for (int j = 0; j < col; j++) {
            if (board[0][j] == 'O')
                q.push_back(pair<int,int> (0, j));
            if (board[row-1][j] == 'O')
                q.push_back(pair<int,int> (row-1, j));
        }
        for (int i = 1; i < row-1; i++) {
            if (board[i][0] == 'O')
                q.push_back(pair<int,int> (i, 0));
            if (board[i][col-1] == 'O')
                q.push_back(pair<int,int> (i, col-1));
        }
        while (!q.empty()) {
            int i = q.front().first, j = q.front().second;
            q.pop_front();
            board[i][j] = 'V';
            if (i-1 >= 0 && board[i-1][j] == 'O')
                q.push_back(pair<int,int> (i-1,j));
            if (i+1 < row && board[i+1][j] == 'O')
                q.push_back(pair<int,int> (i+1,j));
            if (j-1 >= 0 && board[i][j-1] == 'O')
                q.push_back(pair<int,int> (i,j-1));
            if (j+1 < col && board[i][j+1] == 'O')
                q.push_back(pair<int,int> (i,j+1));
        }
        for (int i = 0; i < row; i++) {
            for (int j = 0; j < col; j++) {
                board[i][j] = board[i][j] == 'V' ? 'O' : 'X';
            }
        }
    }
};

